import React, { useState } from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import ProjectWizard from './ProjectWizard';


const { Header, Content, Footer } = Layout;

const ProjectLayout = () => {
    const [activeMenuItem, setActiveMenuItem] = useState('newProject');

    const handleMenuClick = (e) => {
        setActiveMenuItem(e.key);
    };

    return (
        <Layout className="layout">
            <Header>
                <div className="logo" />
                <Menu theme="dark" mode="horizontal" selectedKeys={[activeMenuItem]} onClick={handleMenuClick}>
                    <Menu.Item key="newProject">New Project</Menu.Item>
                    <Menu.Item key="projectList">Project List</Menu.Item>
                </Menu>
            </Header>
            <Content style={{ padding: '0 50px' }}>
                <Breadcrumb style={{ margin: '16px 0' }}>
                    <Breadcrumb.Item>Home</Breadcrumb.Item>
                    <Breadcrumb.Item>{activeMenuItem === 'newProject' ? 'New Project' : 'Project List'}</Breadcrumb.Item>
                </Breadcrumb>
                <div style={{ background: '#fff', padding: 24, minHeight: 280 }}>
                    {activeMenuItem === 'newProject' ? <ProjectWizard /> : <ProjectWizard />}
                </div>
            </Content>
            <Footer style={{ textAlign: 'center' }}>Ant Design Â©2020 Created by Ant UED</Footer>
        </Layout>
    );
};

export default ProjectLayout;
